import React from 'react'
import image from './Images/Homepageimage.png'

const Home = () => {
    return (
        <div className="Homepage_face">
            <img className src={image} alt="homepagelogo" />
          <h1>WELCOME</h1>
    
          <h2>We are The MERN Developer</h2>  
        </div>
    )
}

export default Home
